import React from 'react';
import queryString from 'query-string';


export default class ResendVerification extends React.Component{
    render(){
        const query = queryString.parse(this.props.location.search);

        return (
            <section>
                <form>
                    <fieldset>
                        <label htmlFor="ver_email">Email:</label>
                        <input type="text" id="ver_email"></input>
                        <label htmlFor="ver_password">Password:</label>
                        <input type="password" id="ver_pass"></input>
                    </fieldset>
                </form>
            </section>
        )
    }
}
